import React from "react";
import { useParams } from "react-router-dom";

const DetailJob = (props) => {
  const { params } = props.match;

  return (
    <h3>
      <div>
        <b>Parameter 1: </b>
        {params.id}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.company}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.position}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.location}
      </div>
      <div>
        <b>Parameter 2: </b>
        {params.logo}
      </div>
    </h3>
  );
};

export default DetailJob;
